function showErr(number) {
    switch(number) {
        case 401:
            return "401 Not Authorized"
        case 403:
            return "403 "
    }
}

function NotAuthorized({error}) {

    return (
        <div className='noauth'>
            <p>Error 401 Not NotAuthorized</p>
            <style jsx>{`
                .noauth {
                    float: left;
                    width: 100%;
                    height: 100%;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                }
                p {
                    float: left;
                    margin: 0;
                    font: 18px 'Roboto';
                    color: red;
                }
            `}</style>
        </div>
    )
}

NotAuthorized.getInitialProps = async(ctx) => {
    const message = ctx.query.errorMessage
    return {error: message}
}

export default NotAuthorized
